$(document).ready(function ()
{
    initMenu()
    initGoTop()
    initIcone()

    //Script per la gestione del bottone torna su
    function initGoTop()
    {
        function init()
        {
            $('.scroll-top').click(move)
        }

        function move(e)
        {
            e.preventDefault()
            $('body, html').animate({scrollTop: 0}, 200)
        }
        
        init()
    }

    //Script per la gestione del menu
    function initMenu()
    {
        var overlay
        var submenu = false
        var speed = 300

        var menuOpened = false

        function init()
        {
            overlay = $('#menu_overlay')
            $('header a.dropdown').hover(meouseInOpener, mouseOut)
            $('header .submenu .inner').hover(meouseIn, mouseOut)

            $(window).resize(function (){
                if(!$('header .navbar-collapse.collapse').length){
                    // $('header .navbar-collapse.collapse').removeClass('collapse')

                    const vh = Math.max(document.documentElement.clientHeight || 0, window.innerHeight || 0) - $('#page-header').outerHeight()
                    $('.sfondoMobile').css({height: vh+'px', 'overflow': 'auto'});
                }
            })

            $('.submenu .inner ul:empty').remove();

            // Inizio menu mobile
            var heights = false
            $('.navbar-toggler').click(function() {
                $('#menu_overlay').toggleClass('show')
                $('#nav-icon4').toggleClass('open');
                $('.nav-link-mobile').show();
                $('.nav-extra-mobile').show();

                if(!heights){
                    heights = true
                    setTimeout(function (){
                        $('header .tertiary ul').each(function (){
                            $(this).attr('data-height', $(this).outerHeight())
                            $(this).css('overflow', 'hidden').height(0)
                        })
                        $('.sfondoMobile .secondary > div').addClass('hidden')
                    }, 200)
                }
            });
            $('.navbar-toggler').click(mobileMenu)


            $('#menuDesktop .tertiary > a').click(function(e) {
                e.preventDefault()
                if($(this).parent().hasClass('opened')){
                    $(this).parent().removeClass('opened')
                    $(this).next().css('height', 0)
                }
                else{
                    $(this).parent().addClass('opened')
                    $(this).next().css('height', $(this).next().attr('data-height')+'px')
                }
            });

        }
        function meouseInOpener()
        {
            if(submenu && submenu.index != $(this).parent().index()) submenu.e.removeClass('show')
            else if(!submenu) overlay.addClass('show')

            submenu = {
                index: $(this).parent().index(),
                e: $(this).next(),
                in: true,
                opener: $(this)
            }
            submenu.e.addClass('show')
            centerSubmenu()

            submenu.e.find('ul ul').each(function (){
                if(!$(this).is('[data-height]')){
                    $(this).attr('data-height', $(this).outerHeight())
                    $(this).css('overflow', 'hidden').height(0)
                }
            })
        }

        function mouseOut()
        {
            submenu.in = false
            setTimeout(function (){
                if(!submenu.in){
                    overlay.removeClass('show')
                    if(submenu.e) submenu.e.removeClass('show')
                    submenu = false
                }
            }, speed)
        }

        function meouseIn()
        {
            submenu.in = true
        }

        function centerSubmenu()
        {
            var v = submenu.opener.offset().left - (submenu.e.children().outerWidth() / 2) + (submenu.opener.outerWidth() / 2)
            if(v < 0) v = 0
            submenu.e.children().css('left', v)
        }

        function mobileMenu()
        {

            // $('body').css({'overflow': 'hidden'})
            // console.log('asdfasdf')

            if($(this).children().hasClass('open')){
                $('header .navbar-collapse.collapse').removeClass('collapse')
                $('body').css({'overflow': 'hidden'})

                const vh = Math.max(document.documentElement.clientHeight || 0, window.innerHeight || 0) - $('#page-header').outerHeight()
                $('.sfondoMobile').css({height: vh+'px', 'overflow': 'hidden', 'overflow-y': 'auto'});
            }
            else{
                console.log($(this).children())
                $('header .navbar-collapse').addClass('collapse')
                $('body').css({'overflow-y': 'auto'})
            }

            // $('.secondary').hide();
            // $('.secondary').css({height: $(window).height()+'px'});



            // $('.sfondoMobile').css({height: $(window).height()+'px'});

        }

        $('.nav-link-mobile').click(function() {
            $('.secondary').scrollTop(0)
            $('.secondary_back').addClass('show')

            $('.secondary > div').addClass('hidden')
            $('.secondary > div[data-id='+$(this).attr('data-id')+']').removeClass('hidden')
            $('.secondary').addClass('show')
            $('.sfondoMobile .in').css('overflow', 'hidden')
            // $('.sfondoMobile, .sfondoMobile .in').scrollTop(0)

            setTimeout(function (){
                $('.sfondoMobile, .sfondoMobile .in').scrollTop(0)
            }, 300)
        });

        $('.secondary_back').click(function() {
            $('.sfondoMobile, .sfondoMobile .in').scrollTop(0)
            $('.sfondoMobile .in').css('overflow', 'auto')
            $('.secondary_back').removeClass('show')
            $('.secondary').removeClass('show')
            // $('.nav-link-mobile').hide();
            // $('.nav-extra-mobile').hide();
            // $('.secondary').hide();
            // $('.'+ $(this).data('id')).show("slide", { direction: "right" }, 600);
        });

        $('.sfondoMobile .tertiary > a').click(function(e) {
            e.preventDefault()

            if($(this).parent().hasClass('opened')){
                $(this).parent().removeClass('opened')
                $(this).next().css('height', 0)
            }
            else{
                $(this).parent().addClass('opened')
                $(this).next().css('height', $(this).next().attr('data-height')+'px')
            }
        });

        $('.linguaLink').click(function() {
            $('.nav-link-mobile').hide();
            $('.nav-extra-mobile').hide();
            $('.secondary').hide();
            $('.'+ $(this).data('id')).show("slide", { direction: "right" }, 600);
            $('#contenutoLingua').html($('#language_menu').html());
        });

        $('.back').click(function() {
            $('.secondary').hide();
            $('header.navbar .navbar-toggler').show();
            $('.nav-link-mobile').show();
            $('.nav-extra-mobile').show();
        });

        init()
    }

    //Script per gestione delle icone sugli elenchi puntati
    function initIcone(){
        $("li[class^=elenco]").parents('ul').css("list-style-type", "none");
        $("li[class^=elenco]").parents('ul').addClass("elencoPuntato");
    }

});

