/**
* Verifica che non esite giÃ  un preferito con lo stesso link nello storage
*/
function verifica(LinkURL) {
    esistePreferito = false;
    for (i = 0; i < localStorage.length; i++) {
        key = localStorage.key(i);

        if (key.indexOf(NomeStore) > -1) {
            var liste = $.parseJSON(window.localStorage.getItem(key));
            for (var e in liste) {
                if (liste[e]["LinkURL"] == LinkURL) {
                    esistePreferito = true;
                }
            }
        }
    }

    return esistePreferito;
}

/**
* Verifica la chiave del url registrato per impostare il bottone elimina
*/
function verificaChiave(LinkURL) {
    chiave = false;
    for (i = 0; i < localStorage.length; i++) {
        key = localStorage.key(i);

        if (key.indexOf(NomeStore) > -1) {
            var liste = $.parseJSON(window.localStorage.getItem(key));
            for (var e in liste) {
                if (liste[e]["LinkURL"] == LinkURL) {
                    chiave = localStorage.key(i);
                }
            }
        }
    }

    return chiave;
}

/**
* Rimuove l'elemento dallo Storage
*/
function rimuoviElemento(idElemento) {
    $("." + idElemento).remove();
    localStorage.removeItem(idElemento);
}

/**
* Genera una chiave univoca da assegnare all'elemento da archiviare nello Storage
*/
function guid() {
    function s4() {
        return Math.floor((1 + Math.random()) * 0x10000)
          .toString(16)
          .substring(1);
    }
    // return s4() + s4() + '-' + s4() + '-' + s4() + '-' +
    //   s4() + '-' + s4() + s4() + s4();
   idStr = Math.random().toString(16).slice(-4);
    return idStr;
}
