function scrollToAnchor(aid){
    var aTag = $("a[name='"+ aid +"']");
    $('html,body').animate({scrollTop: aTag.offset().top -80},'slow');
}

//Ricerca dei comuni in pagina comuni
$("#avvioRicerca").on("click", function () {
    var search_str = $("#q").val();
    var potereSelezionato = $("input[name='potereSelezionato']").val();
    var trovatoNulla = 0;

    //verifico che il tab comuni non sia nascosto e avvio la ricerca
    if(!$('#tab-'+ potereSelezionato.toLowerCase() + '-comuni').hasClass("d-none")) {

        $('.ricerca-comuni-'+ potereSelezionato).each(function(){
        
            if($(this).text().toUpperCase() == search_str.toUpperCase()){
        
                //verifico se il comune Ã¨ stato scrutinato altrimenti metto un messaggio di avviso
                if($(this).parent().closest('a').length)
                {

                    $([document.documentElement, document.body]).animate({
                        scrollTop: $(this).offset().top - 25
                    }, 200);

                    setTimeout(() => { 
                        $(this).parent().parent().parent().addClass("BackgroundAnime");
                    }, 1000);
    
                    trovatoNulla = 1;
                }
                else
                {
                    trovatoNulla = 2;
                    $('.invalid-feedback').text("Il comune '"+ search_str +"' non Ã¨ ancora stato scrutinato");
                    $('.invalid-feedback').show();
                }
            }

         });
    }

    //Messaggio di errore in caso non abbia trovato il comune desiderato.
     if(trovatoNulla == 0)
     {
         $('.invalid-feedback').text("Il comune '"+ search_str +"' non Ã¨ presente in lista");
         $('.invalid-feedback').show();
     };

     return false;
});

