var TRange=null;

//Funzione per la ricerca testuale in pagina
function findString (str) {
    
	$('.invalid-feedback').hide();

    if (parseInt(navigator.appVersion)<4) return;

    var strFound;

    if (window.find) {

        //CODE FOR BROWSERS THAT SUPPORT window.find

        var original_content = window;
        strFound=original_content.find(str);

        if (!strFound) {
			$('.invalid-feedback').text("Il comune '"+str+"' non Ã¨ presente in lista");
			$('.invalid-feedback').show();
        }
    }
    else if (navigator.appName.indexOf("Microsoft")!=-1) {

        // EXPLORER-SPECIFIC CODE

        if (TRange!=null) {
            TRange.collapse(false);
            strFound=TRange.findText(str);
            if (strFound) TRange.select();
        }
        if (TRange==null || strFound==0) {
            TRange=self.document.body.createTextRange();
            strFound=TRange.findText(str);
            if (strFound) TRange.select();
        }
    }
    else if (navigator.appName=="Opera") {
        alert ("Opera browsers not supported, sorry...")
        return;
    }

    return;
}

//Funzione per minimappa cantone comuni scrutinati
function minicantone(comuniscrutinati)
{
    if($(".minicantone").length) 
    {
        if(comuniscrutinati == 0 )
        {
            $("#ticino25").addClass("st1");
            $("#ticino50").addClass("st1");
            $("#ticino75").addClass("st1");
            $("#ticino100").addClass("st1"); 
        }

        if(comuniscrutinati > 1 && comuniscrutinati <= 35)
        {
            $("#ticino25").removeClass("st1");
            $("#ticino50").addClass("st1");
            $("#ticino75").addClass("st1");
            $("#ticino100").addClass("st1");
        }

        if(comuniscrutinati > 35 && comuniscrutinati <= 58)
        {
            $("#ticino25").addClass("st1");
            $("#ticino50").removeClass("st1");
            $("#ticino75").addClass("st1");
            $("#ticino100").addClass("st1");
        }

        if(comuniscrutinati > 58 && comuniscrutinati <= 90)
        {
            $("#ticino25").addClass("st1");
            $("#ticino50").addClass("st1");
            $("#ticino75").removeClass("st1");
            $("#ticino100").addClass("st1");
        }

        if(comuniscrutinati > 90)
        {
            $("#ticino25").addClass("st1");
            $("#ticino50").addClass("st1");
            $("#ticino75").addClass("st1");
            $("#ticino100").removeClass("st1");
        }

        $(".stNoComuni").html('<tspan x="0" y="5">' + comuniscrutinati + '</tspan>');
    }
}

